import { useParams } from "react-router-dom";
import { useEffect, useState } from "react/cjs/react.development";
import airlineService from "../services/airline.service";



function UserPage(){

    const {flightId} = useParams();
    const[flightFromUser, setFlightFromUser] = useState('');
    const[flightToUser, setFlightToUser] = useState('');
    const[flights , setFlights] = useState([])

    useEffect(() => {
        init();
      }, []);

    const init=()=>{

        airlineService.getAllFlights()
          .then(response => {
            console.log('Printing Flights data', response.data);
            setFlights(response.data);
          })
          .catch(error => {
            console.log('Something went wrong', error);
          }) 
    }

    const displayFlights = () =>{
            console.log(flightFromUser);
            console.log(flightToUser);
    }


    return(
        <div className="container">
                    <div className="container">
                        <div className="container">
            <form>
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="flightfromuser"
                        value={flightFromUser}
                        onChange={(e) => setFlightFromUser(e.target.value)}
                        placeholder="FROM.."
                    />

                </div>
                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control col-4"
                        id="flighttouser"
                        value={flightToUser}
                        onChange={(e) => setFlightToUser(e.target.value)}
                        placeholder="TO.."
                    />

                </div>

                <div >
                    <button onClick={(e) => displayFlights(e)} className="btn btn-primary">Submit</button>
                </div>
            </form>
                        </div>
            <table border="2px">
                <thead>
                    <tr>
                        <td>FLIGHT NAME</td>
                        <td>FROM</td>
                        <td>TO</td>
                        <td>SEATS AVAILABLE</td>
                        <td>ECONOMIC PRICE</td>
                        <td>BUSINESS PRICE</td>
                        <td>FIRST CLASS PRICE</td>
                        <td>DEPARTURE DATE</td>
                        <td>ARRIVAL DATE</td>
                        <td>DEPARTURE TIME</td>
                        <td>ARRIVAL TIME</td>
                    </tr>
                </thead>
                <tbody>
                {
            flights.map(flight => {
                if(flight.flightFrom === flightFromUser && flight.flightTo === flightToUser){
              <tr key={flight.flightId}>
                <td>{flight.flightName}</td>
                <td>{flight.flightFrom}</td>
                <td>{flight.flightTo}</td>
                <td>{flight.totalSeats}</td>
                <td>{flight.economicPrice}</td>
                <td>{flight.businessPrice}</td>
                <td>{flight.firstClassPrice}</td>
                <td>{flight.flightDepartureDate}</td>
                <td>{flight.flightArrivalDate}</td>
                <td>{flight.flightDepartureTime}</td>
                <td>{flight.flightArrivalTime}</td>
              </tr>
                }
            })
          }
                </tbody>
            </table >
            </div>
            <div className='container'>
            <table border="2px">
                <thead>
                    <tr>
                        <td>FLIGHT FROM</td>
                        <td>FLIGHT TO</td>
                        <td>DISCOUNT</td>
                    </tr>
                </thead>
                <tbody>

                </tbody>
            </table>
        </div>
        <div className="container">
            <h3></h3>
        <div className='form-group'>
                <input className="form-control col-4" 
                list="datalistOptions" id="exampleDataList" placeholder="PAYMENT METHOD"/>
                            <datalist id="datalistOptions">
                            <option value="UPI"/>
                            <option value="DEBIT CARD"/>
                            <option value="CREDIT CARD"/>
                            <option value="NET BANKING"/>
                        </datalist>
                </div>
            </div>
        </div>
    )
}

export default UserPage;
